import "./PokeCard.css";

function PokeCard(props) {
  return (
    <li className={`card ${props.type}`}>
      <img
        class="card-image "
        alt={props.name}
        src={`https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/${props.id}.png`}
      />
      <h2 class="card-title">
        {props.id}. {props.name}
      </h2>
      <p class="card-subtitle">{props.types.join(" | ")}</p>
    </li>
  );
}

export default PokeCard;
